import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';

export const Blueprint = ({ data }) => {
  const [activeFloor, setActiveFloor] = useState(0);

  if (!data.floorRegions) return null;

  const { siteBoundary: b, floorRegions, floorWalls, floorDoors } = data;

  const rooms = floorRegions[activeFloor] || [];
  const walls = floorWalls[activeFloor] || { inner: [], outer: [] };
  const doors = floorDoors[activeFloor] || [];

  const scale = 8;
  const p = 50; 
  const w = b.w * scale + (p*2);
  const h = b.h * scale + (p*2);

  const getColor = (type) => {
    switch(type) {
      case 'garage': return '#f1f5f9';
      case 'living': return '#fff7ed'; // Orange 50
      case 'kitchen': return '#ecfeff'; // Cyan 50
      case 'dining': return '#fffbeb';  // Amber 50
      case 'bedroom': return '#f0f9ff'; // Sky 50
      case 'bathroom': return '#f8fafc';
      case 'prayer': return '#f0fdf4';  // Green 50 (Peaceful)
      case 'library': return '#fefce8'; // Yellow 50 (Warm)
      case 'utility': return '#f3f4f6';
      case 'hallway': return '#ffffff';
      case 'stairs': return '#e2e8f0';
      default: return '#ffffff';
    }
  };

  return (
    <div className="flex flex-col h-full items-center justify-center w-full">
      <div className="flex gap-2 mb-4 bg-white p-1 rounded-lg border border-slate-200 shadow-sm">
        {floorRegions.map((_, idx) => (
           <button key={idx} onClick={() => setActiveFloor(idx)}
             className={`px-4 py-1.5 text-sm font-medium rounded-md transition-all ${activeFloor === idx ? 'bg-indigo-600 text-white shadow-sm' : 'text-slate-500 hover:bg-slate-50'}`}>
             {idx === 0 ? 'Ground Floor' : `Level ${idx}`}
           </button>
        ))}
      </div>

      <div className="blueprint-wrapper rounded-lg p-4 overflow-auto max-h-[85vh] bg-white relative">
        <AnimatePresence mode="wait">
        <motion.div
           key={activeFloor}
           initial={{ opacity: 0, x: 10 }} animate={{ opacity: 1, x: 0 }} exit={{ opacity: 0, x: -10 }}
           transition={{ duration: 0.2 }}
        >
          <svg width={w} height={h} viewBox={`0 0 ${w} ${h}`}>
            <defs>
              <pattern id="grid" width="20" height="20" patternUnits="userSpaceOnUse">
                <path d="M 20 0 L 0 0 0 20" fill="none" stroke="#e2e8f0" strokeWidth="0.5"/>
              </pattern>
            </defs>
            <g transform={`translate(${p}, ${p})`}>
              {/* Site */}
              <rect x="-20" y="-20" width={b.w*scale + 40} height={b.h*scale + 40} 
                    fill={activeFloor === 0 ? "#f0fdf4" : "#f8fafc"} rx="10" 
                    stroke={activeFloor === 0 ? "#bbf7d0" : "#e2e8f0"} strokeWidth="1" strokeDasharray="5,5" />
              {/* Grid */}
              <rect x={0} y={0} width={b.w*scale} height={b.h*scale} fill="url(#grid)" stroke="#94a3b8" />

              {/* Rooms */}
              {rooms.map((r, i) => (
                <g key={i}>
                  <rect x={r.x * scale} y={r.y * scale} width={r.w * scale} height={r.h * scale}
                        fill={getColor(r.type)} stroke="#cbd5e1" strokeWidth="1" />
                  <text x={(r.x + r.w/2)*scale} y={(r.y + r.h/2)*scale} className="room-label uppercase tracking-widest">
                    {r.type}
                  </text>
                  {r.type === 'stairs' && (
                     [...Array(6)].map((_, si) => (
                       <line key={si} x1={r.x*scale} y1={(r.y*scale) + (si * 12)} x2={(r.x+r.w)*scale} y2={(r.y*scale) + (si * 12)} className="stair-step" />
                     ))
                  )}
                </g>
              ))}

              {/* Walls */}
              {walls.inner.map((w, i) => <line key={'iw'+i} x1={w.x1*scale} y1={w.y1*scale} x2={w.x2*scale} y2={w.y2*scale} className="wall-inner" />)}
              {walls.outer.map((w, i) => <line key={'ow'+i} x1={w.x1*scale} y1={w.y1*scale} x2={w.x2*scale} y2={w.y2*scale} className="wall-outer" />)}

              {/* Doors */}
              {doors.map((d, i) => (
                <g key={'d'+i}>
                  <rect x={d.vertical ? d.x*scale - 4 : d.x*scale} y={d.vertical ? d.y*scale : d.y*scale - 4} 
                        width={d.vertical ? 8 : d.w*scale} height={d.vertical ? d.w*scale : 8} fill="white"/>
                  <path d={d.vertical 
                      ? `M ${d.x*scale} ${d.y*scale} v ${d.w*scale} a ${d.w*scale} ${d.w*scale} 0 0 1 -${d.w*scale} -${d.w*scale}`
                      : `M ${d.x*scale} ${d.y*scale} h ${d.w*scale} a ${d.w*scale} ${d.w*scale} 0 0 1 -${d.w*scale} -${d.w*scale}`
                    } className="door-swing" />
                </g>
              ))}
            </g>
            <text x={w/2} y={h - 15} textAnchor="middle" fill="#94a3b8" className="text-[10px] font-mono tracking-widest">
               LEVEL {activeFloor} | SHAM-ARCHITECT-SYS
            </text>
          </svg>
        </motion.div>
        </AnimatePresence>
      </div>
    </div>
  );
};
